function Model(){function t(n,t){this.duration=ko.observable(n);this.tokenPrice=ko.observable(t)}var n=this;n.periods=ko.observableArray();data.periods.forEach(n=>new t(n.duration,n.tokenPrice));n.add=function(){n.periods.push(new t(1e3,.001))};n.add();n.remove=function(t){n.periods.remove(t)};n.wallet=ko.observable(data.walletName);n.sender=ko.observable(data.sender);n.addresses=ko.computed(function(){return data.addresses.filter(function(t){return t.wallet==n.wallet()}).map(function(n,t){return{title:"["+t+"] - "+n.address+" - ("+n.amount+" CRS)",address:n.address,amount:n.amount}})});n.setToBold=function(n,t){t&&t.amount>0&&ko.applyBindingsToNode(n,{css:"semi-bold"},t)}}var model=new Model;ko.applyBindings(model);